  totalLength: any;
  p: any;
  deleteIndexId: any;
  localArray_expense: any;
  fileName = 'Expenses.xlsx';
  searchQuery: any;
  isCoOpApartments: any;
  filteredExpense: any;
  logoPath = 'assets/images/login-logo.jpeg';
  expenseForm: FormGroup
